import React, { Component } from "react";
import LodgeDataService from "../services/lodge.service";

export default class AddLodge extends Component {
  constructor(props) {
    super(props);
    this.onChangeName = this.onChangeName.bind(this);
    this.onChangeDescription = this.onChangeDescription.bind(this);
    this.saveLodge = this.saveLodge.bind(this);
    this.newLodge = this.newLodge.bind(this);

    this.state = {
      id: null,
      name: "",
      nrOfBeds: null, 
      nrOfPersons: null,
      freeBeds: null,
      type: "",
      region: "",
    };
  }

  onChangeName(e) {
    this.setState({
      name: e.target.value
    });
  }

  onChangeNrOfBeds(e) {
    this.setState({
      nrOfBeds: e.target.value
    });
    }

    onChangeNrOfPersons(e) {
        this.setState({
            nrOfPersons: e.target.value
        });
    }

    onChangeFreeBeds(e) {
        this.setState({
            freeBeds: e.target.value
        });
    }

    onChangeType(e) {
        this.setState({
            type: e.target.value
        });
    }

    onChangeRegion(e) {
        this.setState({
            region: e.target.value
        });
    }

  saveLodge() {
    var data = {
      name: this.state.name,
      nrOfBeds: this.state.nrOfBeds,
        nrOfPersons: this.state.nrOfPersons,
        freeBeds: this.state.freeBeds,
        type: this.state.type,
      region: this.state.region
    };

    LodgeDataService.create(data)
      .then(response => {
        this.setState({
          id: response.data.id,
          name: response.data.name,
          nrOfBeds: response.data.nrOfBeds,
            nrOfPersons: response.data.nrOfPersons,
            freeBeds: response.data.freeBeds,
            type: response.data.type,
          region: response.data.region

        });
        console.log(response.data);
      })
      .catch(e => {
          console.log(e);

      });
  }

  newLodge() {
    this.setState({
      id: null,
      name: "",
      nrOfBeds: null,
      nrOfPersons: null,
        freeBeds: null,
        type: "",
      region: ""

    });
  }

  render() {
    return (
      <div className="submit-form">
        {this.state.submitted ? (
          <div>
            <h4>You submitted successfully!</h4>
            <button className="btn btn-success" onClick={this.newLodge}>
              Add
            </button>
          </div>
        ) : (
          <div>
            <div className="form-group">
              <label htmlFor="Name">Name</label>
              <input
                type="text"
                className="form-control"
                id="name"
                required
                value={this.state.name}
                onChange={this.onChangeName}
                name="name"
              />
            </div>

            <div className="form-group">
              <label htmlFor="nrofBeds">NrOfBeds</label>
              <input
                type="number"
                className="form-control"
                id="nrOfBeds"
                required
                value={this.state.nrOfBeds}
                onChange={this.onChangeNrOfBeds}
                name="nrOfBeds"
              />
            </div>


             <div className="form-group">
                <label htmlFor="nrOfPersons">NrOfPersons</label>
                 <input
                    type="number"
                    className="form-control"
                    id="nrOfPersons"
                    required
                    value={this.state.nrOfPersons}
                    onChange={this.onChangeNrOfPersons}
                    name="nrOfBeds"
                 />
              </div>

              <div className="form-group">
                 <label htmlFor="freeBeds">freeBeds</label>
                  <input
                     type="number"
                     className="form-control"
                     id="freeBeds"
                     required
                     value={this.state.freeBeds}
                     onChange={this.onChangefreeBeds}
                      name="freeBeds"
                  />
               </div>

              <div className="form-group">
               <label htmlFor="type">type</label>
                <input
                 type="text"
                 className="form-control"
                  id="type"
                  required
                  value={this.state.type}
                  onChange={this.onChangetype}
                  name="type"
                      />
               </div>

               <div className="form-group">
                <label htmlFor="region">region</label>
                   <input
                    type="text"
                     className="form-control"
                      id="region"
                      required
                      value={this.state.region}
                      onChange={this.onChangeRegion}
                      name="region"
                   />
                 </div>


            <button onClick={this.saveLodge} className="btn btn-success">
              Submit
            </button>
          </div>
        )}
      </div>
    );
  }
}
